import React from 'react'
import './Timer.css'

export class Timer extends React.Component {
    constructor(props) {
        super(props);
        this.time = '';
    }
    render() {
        return <div>
            {this.state.time}
        </div>
    }
    componentDidMount() {
        setTimeout(() => {this.props.changeParentStatus(); this.state.time = '1'}, 7000)
    }
}
